import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import Content1 from './components/MainContent/Contents/Content1/Content1';
import Content2 from './components/MainContent/Contents/Content2/Content2';
import { Route, BrowserRouter } from 'react-router-dom';

class App extends React.Component {
  render() {
  return (
    <BrowserRouter>
    <div className="App">
        <Header />
        <div className="mainContent">
            <Route path='/task1' component={Content1} />
            <Route path='/task2' component={Content2} />   
        </div>
    </div>
    </BrowserRouter>
  );
}
}

export default App;
